import { Link } from 'react-router-dom' 

const mapStateToProps = state => {
    auth: state.auth
}

const UserProfile = ({auth}) => {
    return (
        <div>
            <h1>user profile</h1>
            <Link to="/">back to homepage</Link>
        </div>    
    )
}
